    true,nt"url": null,nt"notes": "Effects of Climate Change on Global Food
    Production from SRES Emissions and Socioeconomic Scenarios is an update to a major
    crop modeling study by nnthe NASA Goddard Institute for Space Studies (GISS). The
    initial study was published in 1997, based on output of HadCM2 model forced with
    greenhouse gas concentration from the IS95 nnemission scenarios in 1997. Results
    of the initial study are presented at SEDAC's Potential Impacts of Climate Change
    on World Food Supply: Data Sets from a Major Crop Modeling Study, nnreleased in
    2001. The co-authors developed and tested a method for investigating the spatial
    implications of climate change on crop production. The Decision Support System for
    nnAgrotechnology Transfer (DSSAT) dynamic process crop growth models, are specified
    and validated for one hundred and twenty seven sites in the major world agricultural
    regions. Results nnfrom the crop models, calibrated and validated in the major crop-growing
    regions, are then used to test functional forms describing the response of yield
    changes in the climate and nnenvironmental conditions. This updated version is based
    on HadCM3 model output along with GHG concentrations from the Special Report on
    Emissions Scenarios (SRES). The crop yield nnestimates incorporate some major improvements:
    1) consistent crop simulation methodology and climate change scenarios; 2) weighting
    of model site results by contribution to regional and nnnational, and rainfed and
    irrigated production; 3) quantitative foundation for estimation of physiological
    CO2 effects on crop yields; 4) Adaptation is explicitly considered; and 5) nnresults
    are reported by country rather than by Basic Linked System region. The data are
    produced by A. Iglesias and C. Rosenzweig and the maps are produced by the Columbia
    University nnCenter for International Earth Science Information Network (CIESIN).",nt"license_title":
